import React from "react";
import "./Home.css";
import Main from "./Main";
import Review from "./Review";
import Mapper from "./Mapper";
import Backpack from "./Backpack";
import Ask from "./Ask";

const home = (props) => (
  <ParallaxProvider>
    <div style={{ textAlign: "center" }}>
      <Main />
      <h2 className="divider">Our Motivation</h2>
      <Review />
      <Mapper />
      <Backpack />
      <Ask />
    </div>
  </ParallaxProvider>
);

export default home;
